tables.table_schema:
CREATE TABLE feedback_from_users (
  id SERIAL PRIMARY KEY,
  user_id INT NOT NULL,
  feedback_text TEXT NOT NULL,
  date_submitted TIMESTAMP NOT NULL
);

CREATE TABLE feedback_from_stakeholders (
  id SERIAL PRIMARY KEY,
  stakeholder_id INT NOT NULL,
  feedback_text TEXT NOT NULL,
  date_submitted TIMESTAMP NOT NULL
);

CREATE TABLE ai_feedback (
    id INT PRIMARY KEY,
    user_id INT,
    feedback TEXT,
    rating INT
);

CREATE TABLE stakeholders (
    id INT PRIMARY KEY,
    stakeholder_id INT,
    name TEXT,
    role TEXT
);

CREATE TABLE ai_applications (
    id INT PRIMARY KEY,
    application_id INT,
    application_name TEXT,
    description TEXT
);

CREATE TABLE UserFeedback (
    feedback_id SERIAL PRIMARY KEY,
    user_id INT,
    feedback_text TEXT,
    feedback_date TIMESTAMP
);

CREATE TABLE StakeholderFeedback (
    feedback_id SERIAL PRIMARY KEY,
    stakeholder_id INT,
    feedback_text TEXT,
    feedback_date TIMESTAMP
);

CREATE TABLE AIApplications (
    application_id SERIAL PRIMARY KEY,
    application_name VARCHAR(255) UNIQUE,
    application_description TEXT
);

CREATE TABLE User (
    user_id SERIAL PRIMARY KEY,
    username VARCHAR(50) UNIQUE,
    email VARCHAR(100)
);

CREATE TABLE Stakeholder (
    stakeholder_id SERIAL PRIMARY KEY,
    name VARCHAR(100) UNIQUE,
    organization VARCHAR(100)
);
